import React from 'react';
import styled from 'styled-components';


const NavClient = styled.nav`
    width: 20vw;
    height: 100vh;
    overflow: hidden;
    content: '';
    display: flex;
    flex-direction: column;
    position: absolute;
    background-color:  #3bbe38;
    .hello {
border-radius: 50%;
position: absolute;
left: 27.4%;
right: 67.67%;
top: 24.94%;
bottom: 66.5%;

background: #3BBE38;
box-shadow: -10px -10px 20px rgba(255, 255, 255, 0.96), 10px 10px 20px #084806;

    }
`;

export default function NavBar() {
    return (
        <NavClient>
            <img src='/navbackground.png' alt='nav'></img>
            <div className='hello'></div>

        </NavClient>
    )
}
